import react from "react";
import {Link} from "react-router-dom";

const Navbar = () => {
    return (
        <div>
            <div className="navbar navbar-expand-lg navbar-light bg-light">
                <nav className="navbar nav1 bg-dark">
                    <Link to="/home" className="navbar-brand"><h1 className="h1">homepage</h1></Link>
                    <Link to="/signin" className="navbar-brand"><h1 className="h1">Sign in</h1></Link>
                </nav>
            </div>
        </div>
    )
}

export default Navbar;
